import './Description.css';
import { useSearchParams } from 'react-router-dom';

function Description() {
    return (
        <div>
            <div className='description'>
                <p>이용 방법</p>
                <p>1. 터치 후 메뉴를 선택해주세요.</p>
                <p>2. 포장 또는 매장을 선택해주세요.</p>
                <p>3. 메뉴를 선택해주세요.</p>
                <p>4. 결제를 진행해주세요.</p>
                <p>5. 주문 번호를 확인해주세요.</p>
                <p>6. 주문 번호를 제시해주세요.</p>
            </div>
        </div>
    );
};

export default Description;
